📚"Almas irmã não são tão raras quanto eu imaginava. É esplêndido descobrir que há tantas delas no mundo."
.
📚Com a idade já avançada e com cada vez mais dificuldades pra realizar as tarefas da fazenda, os irmãos Matthew e Marila decidem adotar uma criança para auxiliar nessas tarefas, mas um mal entendido acontece e é lhes é enviado uma garota, não qualquer garota, Anne Shirley.
.
📚Anne tem cabelos ruivos (que pra ela são a causa de seus maiores sofrimentos) e uma imaginação maior que a Ilha do Principe Eduardo. A princípio, os irmãos Cuthbert não desejam ficar com a garota mas com poucos instantes com a menina descobrem que ela é aquilo que precisavam (mesmo sem saber).
.
📃Anne de Green Gables é um livro extremamente lindo e encantador do início ao fim. A Anne é perfeita demais e tem uma imaginação, um otimismo e uma confiança que se fosse em qualquer outro personagem eu odiaria mas como é ela eu admiro😜. Ela trás muitas mudanças pra Avonlea e todo mundo que a conhece passa a ver o mundo com outros olhos, com mais imaginação e amor, mesmo muitas vezes achando que ela é uma imaginação fértil demais.
.
📃Os personagens secundários são riquíssimos e a leitura flui muito bem, Matthew é tão tão tão precioso que me faltam palavras pra explicar a relação dele com Anne. Marília é forte, mas no quesito Anne amolece em muitas situações. Diana é alma amiga mais fiel de todas. Gilbert é Gilbert 💖
.
